// src/Register.js
import React, { useState } from 'react';
import { Form, Button, Container } from 'react-bootstrap';

const Register = ({ onRegister }) => {
    const [name, setName] = useState('');
    const [surname, setSurname] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [specNumber, setSpecNumber] = useState('');
    const [dob, setDob] = useState('');

    const handleRegister = () => {
        // You can add your registration logic here
        // For simplicity, I'm just logging the form data to the console
        console.log({
            name,
            surname,
            email,
            password,
            specNumber,
            dob,
        });

        // You can add your registration logic here
        // For example, you might send the data to a server or store it in local storage
        // For now, let's just simulate a successful registration
        onRegister();
    };

    return (
        <Container>
            <h2>Register</h2>
            <Form>
                <Form.Group controlId="formName">
                    <Form.Label>Name:</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="Enter your name"
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                    />
                </Form.Group>

                <Form.Group controlId="formSurname">
                    <Form.Label>Surname:</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="Enter your surname"
                        value={surname}
                        onChange={(e) => setSurname(e.target.value)}
                    />
                </Form.Group>

                <Form.Group controlId="formEmail">
                    <Form.Label>Email:</Form.Label>
                    <Form.Control
                        type="email"
                        placeholder="Enter your email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                    />
                </Form.Group>

                <Form.Group controlId="formPassword">
                    <Form.Label>Password:</Form.Label>
                    <Form.Control
                        type="password"
                        placeholder="Enter your password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                    />
                </Form.Group>

                <Form.Group controlId="formSpecNumber">
                    <Form.Label>Spec Number:</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="Enter your spec number"
                        value={specNumber}
                        onChange={(e) => setSpecNumber(e.target.value)}
                    />
                </Form.Group>

                <Form.Group controlId="formDob">
                    <Form.Label>Date of Birth:</Form.Label>
                    <Form.Control
                        type="date"
                        value={dob}
                        onChange={(e) => setDob(e.target.value)}
                    />
                </Form.Group>

                <Button variant="primary" onClick={handleRegister}>
                    Register
                </Button>
            </Form>
        </Container>
    );
};

export default Register;
